    public String  writeIf(String cellName, String str){
        int i = 0;
        String ifstr = "";
        String[] data = str.split("/");
        Map<String,String> map = new HashMap();
        for(String datastr:data){
            String[] data2 = datastr.split(":");

            map.put(data2[0],data2[1]);
        }

        for(String key:map.keySet()){
            i++;
            System.out.println(key+"-----"+map.get(key));
            ifstr =ifstr+"IF("+cellName+"=\""+key+"\",\""+map.get(key)+"\",\"\"";
        }
        for(int j = 0;j<i;j++){
            ifstr = ifstr+")";
        }
        System.out.println(ifstr);

        return ifstr;
    }

